// EventsPage.js
import React, { useEffect, useState } from 'react';
import { getEvents } from '../backend/handlers';
import NavBar from './NavBar';

const EventsPage = () => {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    getEvents()
      .then(data => setEvents(data))
      .catch(error => console.error('Error fetching events:', error));
  }, []);

  return (
    <div style={{
      width: '100vw',
      overflow: 'hidden'
    }}>
      {/* If you want to keep the NavBar, include it here */}
      <NavBar />

      {/* Image from the HomePage */}
      <img src="/home.png" alt="Home" style={{
        width: '100%',
        height: '63%',
        position: 'absolute',
        top: 0,
        left: '50%',
        transform: 'translateX(-50%)',
        zIndex: 1000 
      }} />

      {/* Events list */}
      <div style={{ marginTop: '63%' }}> {/* Adjust this style as needed */}
        {events.map(event => (
          <div key={event.id}>
            <h3>{event.title}</h3>
            <p>{event.startDate} - {event.endDate}</p>
            <button>{event.buttonLabel}</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default EventsPage;
